import React from "react";
import { Jumbotron, Container } from "react-bootstrap";

class JumbotronReact extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Jumbotron fluid>
          <Container className="p-4">
            <h1>Proyectos</h1>
            <p className="font-italic">
              "Para eso se necesita locura; locura, ¿oyes? ¡El todo por el
              todo!”, Zorba el griego, Nikos Kazantzakis
            </p>
            <br></br>
            <br></br>
            <br></br>
            <p className="text-success">
              En esta sección encontrarás algunos de mis proyectos.
              Principalmente se encuentran aquellos relacionados con el
              desarrollo web; algunos son proyectos de clase y otros son o bien
              para aprender o tienen una perspectiva profesional. Al final de la
              página también se muestran otros proyectos de otros ámbitos.
            </p>
          </Container>
        </Jumbotron>
      </React.Fragment>
    );
  }
}

export default JumbotronReact;
